//Project Pages Frame --- --- --- --- ---




//Intro Scene ---------

.Projects-Intro-Wrap {
    width: 100%;
    height: 100vh;
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    z-index: 10001;
}   

    .Projects-Intro-Inner {
        width: 100%;
        height: 100%;
        position: relative;
    }

        .Project-Intro-Slide {
            width: 100%;
            height: 100%;
            position: absolute;
            top: -100%;
            left: 0;
            right: 0;
            transition: all;
        }

            .Projects-Intro-Logo {
                width: 80px;
            }

            .Project-Intro-Slide1 {
                background-color: rgb(240, 240, 240);
            }
            .Project-Intro-Slide2 {
                background-color: #141414;
                display: flex;
                justify-content: center;
                align-items: center;
            }






//Intro Section --------- -------- ------ ---- -- -
.ProjectIntro {
    width: 100%;
    height: 100vh;
    position: relative;
}

    .ProjectIntro-BG {
        width: 100%;
        height: 100%;
        position: absolute;
        opacity: .6;
    }

    .ProjectIntro-Scroll {
        position: absolute;
        font-size: 10px;
        letter-spacing: 2px;
        bottom: 20px;
        left: 50%;
        transform: translateX(-50%);
    }

    .ProjectIntro-Content {
        width: 100%;
        position: absolute;
        bottom: 0;
        left: 0;
        right: 0;
    }

        .ProjectIntro-ContentWrap {
            width: 100%;
            max-width: 1920px;
            height: 100%;
            margin: 0 auto;
            position: relative;
            padding-left: 10%;
        }

            .ProjectIntro-Title {
                font-size: 100px;
                font-family: aktiv-grotesk-condensed, sans-serif;
                font-weight: 900;
                font-style: normal;
                text-transform: uppercase;
            }

            .ProjectIntro-Info {
                width: 100%;
            }

            .ProjectIntro-Links {
                width: 350px;
                padding-left: 10px;
                display: flex;
                justify-content: space-between;
            }

                .ProjectIntro-LinkWrap {
                    width: 100%;
                    margin-bottom: 10px;
                }
                    .GitHubLink {
                    }

                    .WebsiteLink {
                    }

                    .ProjectIntro-Link {
                        font-size: 16px;
                        font-weight: 600;
                        text-transform: uppercase;
                        white-space: nowrap;
                    }
                        .ProjectIntro-Link:hover {
                           color: rgba(240, 240, 240, 0.5)
                        }



                .ProjectIntro-Descriptions {
                    padding-left: 10px;
                    margin-bottom: 80px;
                }

                .ProjectIntro-Type {
                    font-size: 12px;
                    text-transform: uppercase;
                    margin-bottom: 10px;
                    white-space: nowrap;
                }

                .ProjectIntro-Date {
                    font-size: 12px;
                    text-transform: uppercase;
                    white-space: nowrap;
                }


@media screen and (max-height: 700px){
    .ProjectIntro-Descriptions {
        margin-bottom: 40px;
    }
}

@media screen and (max-width: 900px){
    .ProjectIntro-BG {
        background-position: right;
    }
}
@media screen and (max-width: 740px){
    .ProjectIntro-Title {
        font-size: 80px;
    }

}

@media screen and (max-width: 570px){
    .ProjectIntro-Title {
        font-size: 50px;
        margin-bottom: 10px;
    }
    .ProjectIntro-Link {
        font-size: 16px;
        font-weight: 600;
    }
    .WebsiteLink {
    }
    .ProjectIntro-Links {
        display: block;
    }
}

@media screen and (max-width: 500px) {
    .ProjectIntro-Title {
        font-size: 50px;
    }

}


//SPWA Text Section ----------- ------------ --------- 
.ProjectSPWA {
    width: 100%;
    padding: 100px 40px;
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: #FFF;
    color: #141414;
}

    .ProjectSPWA-Content {
        max-width: 700px;
    }

        .ProjectSPWA-Header {
            font-size: 32px;
            font-weight: 700;
            text-transform: uppercase;
            white-space: nowrap;
            margin-bottom: 40px;
        }



        .ProjectSPWA-Text {
            padding-left: 300px;
            line-height: 24px;
            margin-bottom: 20px;
        }

@media screen and (max-width: 800px){
    .ProjectSPWA-Text {
        padding: 0;
        font-size: 14px;
    }
}
@media screen and (max-width: 500px){
    .ProjectSPWA-Header {
        font-size: 24px;
        margin-bottom: 30px;
    }
    .ProjectSPWA-Text {
        font-size: 12px;
    }
    .ProjectSPWA-Content {
        max-width: 100%;
    }
}





//MockUp(s) ----------------------- ----------------
.ProjectDisplay-Mock {
    width: 100%;
    height: 160vh;
}
    .Mock1-BG {
        width: 100%;
        height: 100%;
    }

.ProjectDisplay-Mock2 {
    width: 100%;
    height: 100vh;
    background-color: #000;
}
    .Mock2-BG {
        width: 100%;
        height: 100%;
    }

@media screen and (max-width: 1100px){
    .ProjectDisplay-Mock2 {
        height: 90vw;
    }
}
@media screen and (max-width: 700px){
    .ProjectDisplay-Mock {
        height: 90vh;
    }
}




//Tech ----------------------- ----------------
.ProjectTech {
    width: 100%;
    padding: 100px 40px;
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: #FFF;
    color: #141414;
}

    .ProjectTech-Content {
        max-width: 700px;
    }

        .ProjectTech-Header {
            font-size: 32px;
            font-weight: 700;
            text-transform: uppercase;
            white-space: nowrap;
            margin-bottom: 40px;
        }

            .ProjectTech-Text {
                padding-left: 300px;
                line-height: 24px;
                margin-bottom: 20px;
            }

                .ProjectTech-Languages {
                    padding-left: 300px;
                    font-size: 16px;
                    font-weight: 600;
                    line-height: 32px;
                    text-transform: uppercase;

                    span {
                        margin-right: 10px;
                    }
                }

@media screen and (max-width: 800px){
    .ProjectTech-Text {
        padding: 0;
        font-size: 14px;
    }
    .ProjectTech-Content {
        width: 100%;
    }
    .ProjectTech-Languages {
        padding-left: 0;
    }
}
@media screen and (max-width: 500px){
    .ProjectTech-Header  {
        font-size: 24px;
        margin-bottom: 30px;
    }
    .ProjectTech-Text {
        font-size: 12px;
    }

}



//-Mobile Text Section ----------- ------------ --------- 
.Project-Mobile {
    width: 100%;
    padding: 100px 40px;
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: #FFF;
    color: #141414;
}

    .Project-Mobile-Content {
        max-width: 700px;
    }

        .Project-Mobile-Header {
            font-size: 32px;
            font-weight: 700;
            text-transform: uppercase;
            white-space: normal;
            margin-bottom: 40px;
        }

        .Project-Mobile-Text {
            padding-left: 300px;
            line-height: 24px;
            margin-bottom: 20px;
        }

@media screen and (max-width: 800px){
    .Project-Mobile-Text {
        padding: 0;
        font-size: 14px;
    }
}
@media screen and (max-width: 500px){
    .Project-Mobile-Header {
        font-size: 24px;
        margin-bottom: 30px;
    }
    .Project-Mobile-Text {
        font-size: 12px;
    }
    .Project-Mobile-Content {
        max-width: 100%;
    }
}


//Project Closing ----------- ------------ ---------
.ProjectPage-Closing {
    width: 100%;
    padding: 100px 0;
    padding-left: 10%;
    background-color: #000;
}

    .ProjectPage-ClosingText {
        font-size: 14px;
        font-weight: 300;

    }

    .ProjectPage-ClosingProjectTitle {
        font-size: 90px;
        font-weight: 900;
    }

        .ProjectPage-ClosingLink:hover {
            color: rgba(240, 240, 240, 0.5)
        }

@media screen and (max-width: 1000px){
    .ProjectPage-Closing {
        margin-top: 0;
    }
    .ProjectPage-ClosingProjectTitle {
        font-size: 12vw;
        margin: 1.3vw 0;
    }
}

@media screen and (max-width: 700px){
    .ProjectPage-ClosingText {
        font-size: 12px;
    }
}






.WhiteSpaceWrap {
    white-space: normal;
}
